import { CourseCard } from "../styles/card";

export const CardCourse = () => {
  <CardCourse>
    <div className="timetable">
      <div className="date">
        1 - 3 <br /> Out
      </div>
      <div className="time">06:30 à 10:30</div>
    </div>
  </CardCourse>;
};
